      SELECT - CAST ( + - 5 AS INTEGER ) AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col1 BETWEEN NULL AND + + col2 + + col2 + + - 42;
  - name: tab1

outputs:
